// ==UserScript==
// @name            Right Click Search
// @namespace       https://addons.mozilla.org/en-US/firefox/addon/greasemonkey/
// @description     This adds extra search functionality to the right click menu for selected text.
// @version         0.1
// @author          DavidMR
// @include         *
// @exclude         file://*
// @require  				http://ajax.googleapis.com/ajax/libs/jquery/2.1.0/jquery.min.js
// @downloadURL https://update.greasyfork.org/scripts/414406/Right%20Click%20Search.user.js
// @updateURL https://update.greasyfork.org/scripts/414406/Right%20Click%20Search.meta.js
// ==/UserScript==

/*
Using the menu items below, its easy to add a template to the site you want to search,
just get the search URL, add it to the menu, and the selected text will be search on that site.
*/
var myMenu = $( `
    <menu type="context" id="searchMenu">\
				<menuitem data-bg-search="Scan" label="Search Scan" icon="data:image/png;base64,"></menuitem>
				<menuitem data-bg-search="Amazon" label="Search Amazon" icon="data:image/png;base64,"></menuitem>
        <menuitem data-bg-search="IMDB"  label="Search IMDB" icon=" data:image/png;base64,"></menuitem>
    </menu>
` ).appendTo("body");

$("body").attr("contextmenu", 'SearchMenu');

myMenu.on ("click", "menuitem", function (zEvent) {
    var targSearch = $(this).data("bgSearch")  ||  "ERROR";
		var selText = getSelectionText();
  	if ($.trim(selText) == "") return;
    switch(targSearch) {
      	case "Scan":
        		/* URL can be modified/added to be .com, .in etc... */
        		window.open("https://www.scan.co.uk/search?q=" + encodeURIComponent(selText));
        		break;
      	case "Amazon":
        		window.open("https://www.amazon.co.uk/s?k=" + encodeURIComponent(selText));
        		break;
				case "IMDB":
        		window.open("https://www.imdb.com/find?q=" + encodeURIComponent(selText));
            break;
        default:
            break;
    }
} );
function getSelectionText() {
    var text = "";
    if (window.getSelection) {
        text = window.getSelection().toString();
    } else if (document.selection && document.selection.type != "Control") {
        text = document.selection.createRange().text;
    }
    return text;
}

